import json

# Read the file to extract the needed information about the forecasted Ap values
file_path = '/home/gridsan/elai/Kramabench/data/astronomy/input/geomag_forecast/0309geomag_forecast.txt'

def extract_forecasted_ap(file_path):
    try:
        with open(file_path, 'r') as file:
            lines = file.readlines()

            for line in lines:
                if "Predicted Ap" in line:
                    # Extract the values which are found after "Predicted Ap"
                    forecasted_values = line.split("Predicted Ap ")[1].strip()
                    return forecasted_values
    except FileNotFoundError:
        return None

# Extract the forecasted values
forecasted_ap_values = extract_forecasted_ap(file_path)

# Prepare the JSON answer
main_answer = file_path if forecasted_ap_values else None
subtask_1_answer = "The file describes the forecasted Ap values in the line starting with 'Predicted Ap'."

# Print the answers in a JSON format
print(json.dumps(
    {
        "main-task": main_answer,
        "subtask-1": subtask_1_answer
    }, indent=4
))

import json

def find_observed_ap_files():
    files = [
        '/home/gridsan/elai/Kramabench/data/astronomy/input/geomag_forecast/0311geomag_forecast.txt',
        '/home/gridsan/elai/Kramabench/data/astronomy/input/geomag_forecast/0312geomag_forecast.txt',
        '/home/gridsan/elai/Kramabench/data/astronomy/input/geomag_forecast/0313geomag_forecast.txt'
    ]

    observed_ap_dates = {
        "0311geomag_forecast.txt": "Observed Ap 10 Mar",
        "0312geomag_forecast.txt": "Observed Ap 11 Mar",
        "0313geomag_forecast.txt": "Observed Ap 12 Mar",
    }

    observed_ap_files = []

    for file in files:
        file_name = file.split('/')[-1]
        target_line_start = observed_ap_dates.get(file_name)

        if target_line_start:
            with open(file, 'r') as f:
                content = f.readlines()

                for line in content:
                    if line.startswith(target_line_start):
                        observed_ap_files.append(file_name)
                        break

    return {
        "subtask-1": observed_ap_files[0],
        "subtask-2": observed_ap_files[1],
        "subtask-3": observed_ap_files[2],
        "main-task": observed_ap_files
    }

answers = find_observed_ap_files()

print(json.dumps(answers, indent=4))

import json

# This function will parse the data to extract the forecasted Ap indices
def extract_forecast_ap(file_path):
    forecasted_ap = {}
    try:
        with open(file_path, 'r') as file:
            for line in file:
                if line.startswith("Predicted Ap"):
                    # Extract the forecast Ap values
                    parts = line.split(':')[-1].strip().split('-')
                    forecasted_ap = {
                        "March 10, 2025": int(parts[0]),
                        "March 11, 2025": int(parts[1]),
                        "March 12, 2025": int(parts[2])
                    }
                    break
    except Exception as e:
        print(f"An error occurred: {e}")
    return forecasted_ap

